import React, { Component } from 'react';
import {CardBody,CardText} from 'reactstrap';
 class  Card extends Component{
         render(){
        return(
                
                
                  <div className="card  mb-3 mt-5" style={{maxWidth: "20rem"}}>
        
                 <div className="card-body">
                  <h4 className="card-text">
                          
                  </h4>
                   {this.props.notes}
                 </div>
          </div>
          
        );
         }
                
               

    
}
export default Card;
